import React, { Component } from 'react';



export default class Login extends Component {


    checkLogin(userName, userPass, name){
       name.map((loginUser) => {
           if(loginUser.loginName === userName ){
                console.log("success")
           }
           if(loginUser.loginName !== userName){
               console.log("faild")
           }
       }) 
    }

    render () {
        const {name} = this.props;
        let {userName} ='';
        let {userPass} ='';
        return(
            <div className = "Login">
                <input type = "text" placeholder= "User Name" value = {userName} />
                <input type = "password" placeholder="password" value ={userPass} />
                <button value = "Login" onClick = {this.checkLogin(userName, userPass, name)}/>
            </div>
        )
    }
}
